window.bookSummaryJSON = "<p><b>She's my last chance. Those four words echo in Violet Spencerâ€™s mind, tugging at her curiosity even as rage builds within her.</b></p> <p>Arbon Academy was supposed to be a bright new start. An opportunity for greatness, and something an orphan girl could only dream of. For a while there, it seemed to be exactly that.</p> <p>But Violet's bright future is suddenly looking dim. Arbon Academy and Prince Alex are nothing but a facade. A trap.</p> <p>In a sinister world of ballgowns and backstabbing, of perfumes and politics, of indulgent parties and illegal sword fights, Violet now faces the biggest challenge of all: recovering her shattered heart from the prince who crushed it.</p> <p>Supported by her new friends, Violet wants to make Alex feel the pain of his betrayal. Prince Rafe wants nothing more than to help make that happen, but things aren't always so straightforward.</p> <p>Don't break tradition.</p> <p>Don't let them know you know.</p> <p>Don't lose your heart...again.</p> <p>These rules will keep Violet alive. But at what cost?</p>"; 
